items.abstract:
Der allgemeine digitale Wandel führt zu tiefgreifenden Veränderungen in den Forschungs- und Publikationsprozessen. Neue Kommunikationswege werden zunehmend für den wissenschaftlichen Austausch genutzt. Die Datengrundlage für die Messung dieser Wissenschaftskommunikation bilden die sogenannten alternativen Metriken, Altmetrics. Neben sozialen Netzwerken, Blogs, Bookmarking-Diensten und Online-Literaturverwaltungen zählen dazu ebenfalls Kennzahlen wie Downloads oder Views. 
  
  Die Ermittlung von Nutzungszahlen aus der Vielfalt verschiedenartiger Publikationsformen, Artikel, Datensets, Blogposts, Online-Evaluationssysteme, soziale Netzwerke, erfordert einen übermäßig hohen Aufwand. Anbieter von Altmetrics-Diensten entwickeln Konzepte, um diese Kennzahlen auf einer Plattform zu integrieren und zusätzliche Funktionalitäten für die Weiterverarbeitung der Daten bereitzustellen. Zu den heute etablierten Services gehören PLoS Article-Level Metrics, ImpactStory, Altmetric und PlumAnalytics. Deren Angebote wurden aus Anwendersicht anhand eines erarbeiteten Kriterienkatalogs verglichen. Von Interesse waren Aspekte der inhaltlichen Abdeckung, Nutzbarkeit, Nachvollziehbarkeit und Offenheit der Systeme. Außerdem wurde die Frage erörtert, inwieweit Altmetrics bereits Beachtung in der Medizin finden. &gt;
  
  Im Ergebnis des Vergleichs zeigten sich in mehrfacher Hinsicht erhebliche Unterschiede. Dazu gehören das analysierte Datenmaterial (Artefakte), die Einzelmetriken, Bewertungsverfahren, Schnittstellen, Reporting-Optionen und das jeweilige Geschäftsmodell.
